import React from 'react'
import ToDoItem from '../ToDoItem/ToDoItem';
import s from '../ToDoList/styleToDoList.module.css'

export default function ToDoList() {



  return (
    <div className={s.ToDoList}>
        {
          <ToDoItem/>
        }
    </div>
  )
}
